import React, { Component } from 'react';
import { Route, NavLink } from 'react-router-dom';
import axios from 'axios';
import queryString from 'query-string';
import { Card } from 'antd';
import { q1, q2, q3, q4, q5, q6, q7, q8, q9, q10 } from './Questions';

class UnivInterview extends Component {
	state = {
		interview: null,
	}

	componentDidMount() {
		const values = queryString.parse(this.props.location.search);
	 	const id = values.id;
	 	axios.get('https://interview-corner-1de29.firebaseio.com/updated-interviews/' + id + '.json')
	 	.then(response => {
	 		this.setState({interview: response.data })
	 		console.log(response.data);
	 	});
	}

	render() {
		let interview = <div>Loading...</div>;
		if(this.state.interview) {
			const int = this.state.interview;
			console.log('int', int);
			interview = (
				<Card title= {int.name}>
					<div style={{
				        fontSize: 16,
				        color: 'rgba(0, 0, 0, 0.85)',
				        marginBottom: 16,
				        fontWeight: 500,
				      }}>
					    <h3>Interviewed for : {int.company} in {int.college}</h3>
						<p style={{fontWeight: 900}}>{q1}</p><p>{int.questions.q1}</p>
						<p style={{fontWeight: 900}}>{q2}</p><p> {int.questions.q2}</p>
						<p style={{fontWeight: 900}}>{q3}</p><p> {int.questions.q3}</p>
						<p style={{fontWeight: 900}}>{q4}</p><p> {int.questions.q4}</p>
						<p style={{fontWeight: 900}}>{q5}</p><p> {int.questions.q5}</p>
						<p style={{fontWeight: 900}}>{q6}</p><p> {int.questions.q6}</p>
						<p style={{fontWeight: 900}}>{q7}</p><p> {int.questions.q7}</p>
						<p style={{fontWeight: 900}}>{q8}</p><p> {int.questions.q8}</p>
					   	<p style={{fontWeight: 900}}>{q9}</p><p> {int.questions.q9}</p>
					   	<p style={{fontWeight: 900}}>{q10}</p><p> {int.questions.q10}</p>
				   	</div>
				</Card>
			)
		}

		return (
			<div>
			{interview}
			</div>
		);
	}
}

export default UnivInterview;
